import "./style.css";

function Service(){
    return(
        <div className="service">

            <div className="truck">
                <div className="truck_img imageDiv">
                    <div></div>
                </div>
            </div>

            <div className="ocean">
            <div className="ocean_img imageDiv"></div>
            </div>

            <div className="railway">
            <div className="railway_img imageDiv"></div>
            </div>
        </div>
    )
}

export default Service;
